import React from "react";
import { Text } from "./src/components";
import { C } from "./src/style/constants";
import { colorsToTxt } from "./src/utils/colorsToTxt";

export default function App() {
  const colors = colorsToTxt(C);
  const colorsAsConst = [...colors] as const;
  type Colors = typeof colorsAsConst[number];
  const animals = ["white", "red", "blue"] as const;
  type Animal = typeof animals[number];
  console.log(["cat", "dog", "mouse"], colors);
  return (
    <Text textExtraSmall color="">
      NIKI TEKST
    </Text>
  );
}
